intro:
Hi everyone, I am Oleg Malyshkin - Senior Test Automation Engineer in GlobalLogic, a Hitachi Group Company, one of the leading digital product engineering companies.In my company I am responsible for:• Collaborating with development teams, business analysts, and product owners to understand project requirements. • Creating and maintaining test cases, test scenarios, and test data based on functional and non-functional requirements.• Maintaining, updating and refactoring existing automation project - test coverage was increased by implementing additional automated tests for new features; - test execution time was reduced by optimizing existing automated test scripts; - success rate of automation tests was increased by refactored existed ones; - tests have become more robust and stable..• Integrating test automation with CI/CD pipelines, monitoring and troubleshooting test failures and collaborating with development teams to address issues.• Code reviewing of automation project.• Providing technical guidance to the automation QA team. Helping team members with scripting, coding, and troubleshooting challenges.My skills and qualifications:Programming language: Java;Automation: Selenium/Selenide, JUnit/TestNG, Cucumber, Rest Assured, Active JDBC;CI/CD tools: Jenkins, TeamCity, GitLab;Build systems: Gradle, Maven Version control tools: GitHub, GitLab, Bitbucket;Tools: Postman, SoapUI, Jmeter;Data bases: MySQL, PostgreSQL, Oracle, MSSQL;I stay ahead of the curve by reviewing professional publications, trying to use new technologies in projects. It helps me to improve our automation project, so our automation framework does not become out of date. I'm also outgoing and polite team member, so my colleagues often ask me for help and of course I help. And of course, I'm multi-tasking and prioritizing competing deadlines, so It helps me to focus on all tasks that I need to get done and do not forget about priorityHi everyone, I am Oleg Malyshkin - Senior Test Automation Engineer in GlobalLogic, a Hitachi Group Company, one of the leading digital product engineering companies.

In my company I am responsible for:

• Collaborating with development teams, business analysts, and product owners to understand project requirements. 
• Creating and maintaining test cases, test scenarios, and test data based on functional and non-functional requirements.
• Maintaining, updating and refactoring existing automation project
  - test coverage was increased by implementing additional automated tests for new features;
  - test execution time was reduced by optimizing existing automated test scripts;
  - success rate of automation tests was increased by refactored existed ones;
  - tests have become more robust and stable..
• Integrating test automation with CI/CD pipelines, monitoring and troubleshooting test failures and collaborating with development teams to address issues.
• Code reviewing of automation project.
• Providing technical guidance to the automation QA team. Helping team members with scripting, coding, and troubleshooting challenges.

My skills and qualifications:
Programming language: Java;
Automation: Selenium/Selenide, JUnit/TestNG, Cucumber, Rest Assured, Active JDBC;
CI/CD tools: Jenkins, TeamCity, GitLab;
Build systems: Gradle, Maven 
Version control tools: GitHub, GitLab, Bitbucket;
Tools: Postman, SoapUI, Jmeter;
Data bases: MySQL, PostgreSQL, Oracle, MSSQL;

I stay ahead of the curve by reviewing professional publications, trying to use new technologies in projects. It helps me to improve our automation project, so our automation framework does not become out of date. I'm also outgoing and polite team member, so my colleagues often ask me for help and of course I help. And of course, I'm multi-tasking and prioritizing competing deadlines, so It helps me to focus on all tasks that I need to get done and do not forget about priority


